import React, { useState } from "react";
import SidebarDashboard from "../components/sidebarDashboard";
// import TemplateOrden from "../components/templateorden";

import jsPDF from "jspdf";
import { TemplateOrden } from "../components/templateorden";

const OrdenDetail = () => {
  const [navSidebar, setNavSidebar] = useState(true);
  const show_sidebar = () => {
    setNavSidebar(!navSidebar);
  };

  //   Generar PDF con jsPDF
  const generatePDF = () => {
    var doc = new jsPDF("p", "pt", "letter");
    // var dataUrl =
    //   "data:image/png;base64,";
    // doc.addImage(dataUrl, "png", 10, 8, 50, 20);
    doc.html(document.querySelector("#report-orden"));
    // doc.save("ordenes.pdf");
    doc.html(document.querySelector("#report-orden"), {
      callback: function (pdf) {
        var dataUrl1 =
          "data:image/jpeg;base64,";
        doc.addImage(dataUrl1, "png", 40, 40, 24, 24);

        var dataUrl2 =
          "data:image/png;base64,";
        doc.addImage(dataUrl2, "png", 64, 40, 80, 23.44);
        pdf.save("ordenes.pdf");
      },
    });
  };
  //   fin de generar pdf

  return (
    <>
      <SidebarDashboard navSidebar={navSidebar} show_sidebar={show_sidebar} />
      <div
        className={`container-dashboard ${!navSidebar ? "close_sidebar" : ""}`}
      >
        <h1>Hola ordenes details</h1>

        <button className="btn btn-primary" onClick={generatePDF}>
          Generate PDF
        </button>
        <TemplateOrden />
      </div>
    </>
  );
};

export default OrdenDetail;
